//console.log("Loading Map1DLib.js");

function Map1D() {
    this.Show=function(state,matrix,item,skeys,key,values,comp){
	var row = document.createElement("TR");
	state.Html.appendDataElement(state,row,"Not implemented","lightgray");
	item.appendChild(row);
    }
};
export default Map1D;
